RECORDS["_284"] = new MedievalDocuments("_284", 1655, "Caloin vinde lui Stoica, iuzbașa din Berciugovu <j. Ilfov>, și fratelui său Micu, o vie cu 12 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Caloin", null, "Țara Românească", "2", "1655 (7164);noiembrie 16");
RECORDS["_285"] = new MedievalDocuments("_285", 1655, "Iane din Die cu fiii săi, Nica și Hiștov, se vând rumâni lui Pană postelnic, cu 36 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Iane cu fiii săi, Nica și Hiștov", null, "Țara Românească", "2", "1655 (7164);noiembrie 16");
