RECORDS["_425"] = new MedievalDocuments("_425", 1654, "Constantin Șerban voievod întărește lui Buliga, fost mare agă de dorobanți, dreptul de stăpânire asupra satului Seaca Carava, j. Mehedinți, cu rumânii, pentru dreaptă și credincioasă slujbă făcută domniei și țării.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);aprilie 25");
