RECORDS["_430"] = new MedievalDocuments("_430", 1654, "Constantin Șerban voievod întărește lui Drăghici, fiul lui Sărdea armaș din Bănești, j. Vlașca, ocină la Sângeriș de la Gura Foi<i>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);aprilie 27");
RECORDS["_431"] = new MedievalDocuments("_431", 1654, "Constantin Șerban voievod întărește lui Stanciu logofăt din Budișteni, ocinile din Budișteni, Dolheștii de sus și de jos, Crângureni, toate în j. Argeș, în contul zestrei pe care ar fi trebuit să o primească din partea jupânesei Anca, soacra sa.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);aprilie 28");
RECORDS["_432"] = new MedievalDocuments("_432", 1654, "<Patriarhul Macarie> al Antiohiei dă carte diaconului Ghinea din Râmnic să ție codrul de la Bogdănești cu moara și siliștea, cumpărate de la socrul său, Stanciul Sarchiz.", null, null, null, "Constantin Șerban", "<Patriarhul Macarie> al Antiohiei", null, "Țara Românească", "3", "<1654 mai>");
RECORDS["_433"] = new MedievalDocuments("_433", 1654, "Maria, fata lui Stan și sora lui Arion din Dumirești, vinde jupânului Câșlegă negustor partea ei de moșie din funia pulpască, a patra parte, pentru 34 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Maria, fata lui Stan și sora lui Arion din Dumirești", null, "Țara Românească", "3", "1654 (7162);mai 1");
RECORDS["_434"] = new MedievalDocuments("_434", 1654, "Stanciul, Cristian și Marin, fiii lui Dragomir Băltea vând lui Stoica Bălan moșie la Cărunți, cu livezile de pomi din deal cu 6 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stanciul, Cristian și Marin, fiii lui Dragomir Băltea", null, "Țara Românească", "3", "1654 (7162);mai 1");
RECORDS["_435"] = new MedievalDocuments("_435", 1654, "Constantin Șerban voievod întărește lui Iordache al doilea postelnic Trufanda, satul Ionești, j. Dâmbovița, cu toți rumânii, câți sunt cumpărați și miluiți de Radu Mihnea voievod.", null, "Microfilm", null, "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 2");
RECORDS["_436"] = new MedievalDocuments("_436", 1654, "Constantin Șerban voievod întărește lui Mihai comis și fraților săi, fiii lui Dumitru stolnic Filișanul, satul Dârvariul, j. Mehedinți.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 2");
RECORDS["_437"] = new MedievalDocuments("_437", 1654, "Constantin Șerban voievod întărește lui Șerban postelnic și jupânesei acestuia, Cătălina, fiica lui Vasilache banul, stăpânirea peste jumătate din satul Șuța, trei roți de moară în apa Teleajenului și vii în dealul Scăienilor, confiscat de Matei Basarab voievod pentru hiclenia lui Vasilache banul.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 2");
RECORDS["_438"] = new MedievalDocuments("_438", 1654, "Bădica din Mihăiești vinde jupânului Zota cel Mare din Bărbulești, j. Ialomița, 20 stânjeni de moșie din partea Coruiului și 10 stânjeni din partea lui Crăciun, cu câte 44 bani stânjenul.", "Română", null, "Copie", "Constantin Șerban", "Bădica din Mihăiești", null, "Țara Românească", "3", "1654 (7162);mai 3");
RECORDS["_439"] = new MedievalDocuments("_439", 1654, "Uncheașul Belo și fiul său, Albul din Surdești, vând jupânului Zota cel Mare 30 stânjeni de moșie în Mihăești, j. Ialomița, cu câte 44 bani stânjenul.", "Română", null, "Copie", "Constantin Șerban", "Uncheașul Belo și fiul său, Albul din Surdești", null, "Țara Românească", "3", "1654 (7162);mai 3");
RECORDS["_440"] = new MedievalDocuments("_440", 1654, "Necula logofăt și Ion iuzbașa din Corșori mărturisesc despre pâra dintre Nan logofăt din Berivoești și Mihai postelnic din Pătroaia, pentru niște vie a lui Nan logofăt. Domnul a judecat și a dat viile să le țină Nan logofăt, care să despăgubească pe Mihai postelnic pentru cheltuiala făcută cu lucrul viilor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Necula logofăt și Ion iuzbașa din Corșori", null, "Țara Românească", "3", "1654 (7162);mai 3");
RECORDS["_441"] = new MedievalDocuments("_441", 1654, "Constantin Șerban voievod întărește megieșilor din satul Comănița, j. Olt, dreptul de stăpânire asupra părților lor de ocină din sat, în urma judecății cu egumenul mănăstirii Deleni.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 3");
RECORDS["_442"] = new MedievalDocuments("_442", 1654, "Egumenul mănăstirii Bistrița, Vasilie, se învoiește cu starețul mănăstirii Argeș, Nicolae pentru vinăriciul din dealul Șoașului.", null, null, null, "Constantin Șerban", "Egumenul mănăstirii Bistrița, Vasilie", null, "Țara Românească", "3", "1654 (7162);<ante mai 5>");
RECORDS["_443"] = new MedievalDocuments("_443", 1654, "Constantin Șerban voievod împuternicește mănăstirea Argeș și pe egumenul acesteia, Nicolae, să ia jumătate din vinăriciul domnesc și boieresc din dealul Șoașului, după o judecată cu mănăstirea Bistrița.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 5");
RECORDS["_444"] = new MedievalDocuments("_444", 1654, "Constantin Șerban voievod întărește mănăstirii Argeș vama și judecata orașului Argeș, așa cum au lăsat toți domnii dinaintea lui.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 5");
RECORDS["_445"] = new MedievalDocuments("_445", 1654, "Constantin Șerban voievod poruncește celor 24 de boieri hotarnici ca să hotărască asupra moșiei Cioroiașul, dacă ea aparține locuitorilor satului sau mănăstirii Bucovăț.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 5");
RECORDS["_446"] = new MedievalDocuments("_446", 1654, "Constantin Șerban voievod scrie celor 12 jurători ai lui Stanciu, fiul lui Voico, Dobre, fiul lui Vlad și ai lui Moise cu frații lui, ca să jure dacă aceștia nu au fost rumâni de moșie în satul Lungi <j. Dâmbovița> care aparținea lui Iordache postelnic Trufanda.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai 5");
RECORDS["_447"] = new MedievalDocuments("_447", 1654, "Dumitru, fiul lui Flore, din Mircești, j. Vâlcea, vând lui Cândea și fiilor lui a patra parte din funia lui Țintea, cu braniște, cu 3 ughi și 70 de bani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dumitru, fiul lui Flore, din Mircești", null, "Țara Românească", "3", "1654 (7162);mai 6, „când se-u posu Costandin Vodă domn \"");
RECORDS["_448"] = new MedievalDocuments("_448", 1654, "Constantin Șerban voievod întărește lui Alexandru al doilea postelnic și jupaniței lui, Marica, nepoata doamnei Elena, satul Herăștii, j. Ilfov, cu rumânii, balta și morile de pe apa Ialomiței.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);mai 6");
RECORDS["_449"] = new MedievalDocuments("_449", 1654, "Constantin Șerban voievod întărește lui Iordache al doilea postelnic, fiul lui Trufanda vistier, stăpânirea peste mai mulți vecini din satul lonești, j. Dâmbovița, cu care se judecase în divan.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai 6");
RECORDS["_450"] = new MedievalDocuments("_450", 1654, "Constantin Șerban voievod întărește Episcopiei de Râmnic dreptul de stăpânire asupra satului Plăviceni, j. Romanați, toată partea Doamnei Stanca, după ce Dragomir mare vornic din Plăviceni împresurase acest sat.", null, null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 6");
RECORDS["_451"] = new MedievalDocuments("_451", 1654, "Constantin Șerban voievod întărește lui Tudorie paharnic, fiul lui Harvat spătar, și soției lui, Păuna, satul Curăteștii de pe Neajlov, primit de zestre de la Cârstea căpitanul din Târgoviște.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai 6");
RECORDS["_452"] = new MedievalDocuments("_452", 1654, "Douăzeci și patru de boieri aleg moșia Cioroiașul a mănăstirii Bucovățul, după ce mănăstirea a avut pâră cu satul și după ce domnul a întărit hotărnicia făcută în vremea lui Matei Basarab voievod.", "Română", null, "Copie", "Constantin Șerban", "Douăzeci și patru de boieri", "5176", "Țara Românească", "3", "1654 (7162);mai 7");
RECORDS["_453"] = new MedievalDocuments("_453", 1654, "Radul și cumnatul lui, Dumitru, împreună cu soțiile lor Boba și Neacșa, fetele Dumitrei din Cucuteni, vând episcopului Buzăului, Serafim, moșie la Cucuteni, „moșie muierească\", cu pădure în crâng, pentru 5 ughi și jumătate.", "Română", "Hârtie", "Original", "Constantin Șerban", "Radul și cumnatul lui, Dumitru, împreună cu soțiile lor Boba și Neacșa, fetele Dumitrei din Cucuteni", null, "Țara Românească", "3", "1654 (7162);mai 8");
RECORDS["_454"] = new MedievalDocuments("_454", 1654, "Constantin Șerban voievod poruncește celor 6 boieri luați pe răvaș de Manta, fiul lui Pană din Câmpulung și de egumenul Ioasaf de la mănăstirea din Câmpulung, ca să adeverească pentru o dârstră la Lerești, j. Argeș, făcută de egumen pe iazul lui Manta.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 8");
RECORDS["_455"] = new MedievalDocuments("_455", 1654, "Constantin Șerban voievod întărește lui Simion, fiul lui Lăudat din Beleți, j. Muscel, pe Vlădilă țiganul, după o pâră cu egumenul Daniil de la mănăstirea Râncăciov.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 8");
RECORDS["_456"] = new MedievalDocuments("_456", 1654, "Constantin Șerban voievod întărește mănăstirii Glavaciog și egumenului Nichifor ocină în satul Cernătești, j. Sac, jumătate de sat cu rumânii și viile, după o pâră pe care au avut-o cu rumânii din sat.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai <8>");
RECORDS["_457"] = new MedievalDocuments("_457", 1654, "Constantin Șerban voievod întărește mănăstirii Bucovăț și egumenului loanichie satul Cioroiașul, j. Dolj, cumpărată de Pârvul clucerul, fiul lui Stepan banul, ctitorii mănăstirii, după o pâră cu satul Cioroiașul.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 10");
RECORDS["_458"] = new MedievalDocuments("_458", 1654, "Constantin Șerban voievod întărește moșnenilor din satul Păpălari, j. Romanați, dreptul de stăpânire asupra părților lor de ocină din sat, care le fusese luată cu silnicie de Matei Basarab voievod și dăruită ctitoriei familiei sale de la Brâncoveni.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai 10");
RECORDS["_459"] = new MedievalDocuments("_459", 1654, "Constantin Șerban voievod întărește lui Vlad mazilul și altora o ocină în satul Sărățeni, j. Ialomița, în urma judecății cu călugării de la mănăstirea Vaideei.", null, null, null, "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai 10");
RECORDS["_460"] = new MedievalDocuments("_460", 1654, "Constantin Șerban voievod întărește mănăstirii Potoc, <j. Dâmbovița>, jumătate din satul Celei din j. Romanați, cu rumânii și cu tot venitul, donat de ctitorii ei, în urma judecății cu mănăstirea Arnota, căreia Matei Basarab îi dăruise aceste averi.", null, null, null, "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);<mai> 10");
RECORDS["_461"] = new MedievalDocuments("_461", 1654, "Constantin Șerban voievod îl împuternicește pe Gheorghe vornic din Sărdenești să-l oblige pe Stamatie paharnic, fiul lui Miloș Cuza din Copăceni, j. Gorj, să-i plătească datoria.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 11");
RECORDS["_462"] = new MedievalDocuments("_462", 1654, "Constantin Șerban voievod poruncește celor 4 boieri adeveritori ai lui Stoica din Suslănești și ai lui Gavril din Boteni, să soluționeze pricina dintre Stoica din Suslănești și Gavril din Boteni și anume dacă au umblat cu Radu pârcălab, încasând impozite în județ.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 11");
RECORDS["_463"] = new MedievalDocuments("_463", 1654, "Patriarhul Macarie al Antioihiei întărește lui Neagul mare portar și fiilor săi stăpânirea satului Băcălești, j. Olt, cu rumânii, lăsat de unchiul acestuia, Dumitru Ochiută.", "Română", "Hârtie", "Original", "Constantin Șerban", "Patriarhul Macarie al Antioihiei", null, "Țara Românească", "3", "1654 (7162);mai 12");
RECORDS["_464"] = new MedievalDocuments("_464", 1654, "Constantin Șerban voievod întărește megiașilor din Șchiopeni, j. Buzău, jumătate din sat, în urma unei pâri cu Rada, soția lui Marco armaș și cu Toader postelnic, fiul acestuia.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 12");
RECORDS["_465"] = new MedievalDocuments("_465", 1654, "Udrea comis, fiul lui Hrizea mare vornic din Bălteni, și jupâneasa lui, Alexandra adeveresc unchiașului Badea și fii lor acestuia că le-au vândut părțile lor d e moșie din Tegeni și din Ștefănești, fără voia lor, domnul Constantin Șerban dându-le voie să răscumpere aceste moșii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Udrea comis, fiul lui Hrizea mare vornic din Bălteni, și jupâneasa lui, Alexandra", "5176", "Țara Românească", "3", "1654 (7162);mai 13");
RECORDS["_466"] = new MedievalDocuments("_466", 1654, "Constantin Șerban voievod întărește mănăstirii Jdreala, j. Dolj, să țină pe toți oamenii străini: greci, sârbi, albanezi ce s-au adunat și stau pe lângă mănăstire, scutindu-i de toate dările, cu condiția să devină poslușnici ai mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 13");
RECORDS["_467"] = new MedievalDocuments("_467", 1654, "Stanciu logofăt din Bogătești vinde egumenului Ioasaf al mănăstirii Câmpulung un munte la Rucăr, aflat în dispută cu sătenii din Rucăr <j. MusceI>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stanciu logofăt din Bogătești", null, "Țara Românească", "3", "1654 (7162);mai 14");
RECORDS["_468"] = new MedievalDocuments("_468", 1654, "Mărturia sătenilor din Țâța, j. Dâmbovița, că Tiodoru a cumpărat un loc de la Radul al lui Brașov, în Mlăci, lat de 30 stânjeni, cu 7 ughi fără adălmaș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Tiodoru", null, "Țara Românească", "3", "1654 (7162);mai 14");
RECORDS["_469"] = new MedievalDocuments("_469", 1654, "Constantin Șerban voievod dă voie lui Cârstea iuzbașa de roșii să-și ia înapoi de la urmașii lui Drăgușin paharnic, Gorgan și frații acestuia, țiganii luați de acesta „în silă\".", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 14");
RECORDS["_470"] = new MedievalDocuments("_470", 1654, "Ivan cu frații lui, Stanciu și Paraschiv și alții vând o vie din Dealul de la Alun, împreună cu alte acareturi și obiecte, unchiului lor, Filip <din Baia>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ivan cu frații lui, Stanciu și Paraschiv și alții", "5176", "Țara Românească", "3", "1654 (7162);mai 15");
RECORDS["_471"] = new MedievalDocuments("_471", 1654, "Unchiașul Stoica Robul din Neagovani adeverește egumenului de la Snagov că a avut 3 pogoane de vie ale sale pe ocina mănăstirii de la Negovanul, pe care le-a lăsat mănăstirii, neputându-le lucra.", "Română", "Hârtie", "Original", "Constantin Șerban", "Unchiașul Stoica Robul din Neagovani", null, "Țara Românească", "3", "1654 (7162);mai 15");
RECORDS["_472"] = new MedievalDocuments("_472", 1654, "Tănasie, fiu lui Necula logofăt din Sărăcinești, j. Vâlcea, închină moșia de la Frăgași mănăstirii Cozia și egumenului acesteia, Ștefan, pentru pomenirea sa și a părinților săi.", "Română", null, "Copie", "Constantin Șerban", "Tănasie, fiu lui Necula logofăt din Sărăcinești", null, "Țara Românească", "3", "1654 (7162);mai 15");
RECORDS["_473"] = new MedievalDocuments("_473", 1654, "Constantin Șerban voievod întărește lui Iordache postelnic, fiul lui Trufanda vistier, și urmașilor lui, stăpânire peste partea jupânesei Neaga Mitroaia vorniceasa pe care o avea în satul Lungi, cu toți vecinii, cu morile și cu tot venitul.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 15");
RECORDS["_474"] = new MedievalDocuments("_474", 1654, "Costea și frații lui, Ivan și Oprea, împreună cu mama lor vând lui Firea o păresiște în dealul Crângurenilor, la Budișteni, j. Argeș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Costea și frații lui, Ivan și Oprea, împreună cu mama lor", null, "Țara Românească", "3", "1654 (7162);mai 16");
RECORDS["_475"] = new MedievalDocuments("_475", 1654, "Constantin Șerban voievod întărește hotărârea voievodului Matei Basarab acordată Episcopiei Buzăului să-i fie iertați de bir și dăjdii curtenii și poslușnicii, precum și păstorii, morarii și oamenii de la odaia de la Cărpești, cu condiția ca aceștia toți să slujească Episcopiei.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 16");
RECORDS["_476"] = new MedievalDocuments("_476", 1654, "Constantin Șerban voievod întărește dania lui Matei Basarab făcută Episcopiei Buzăului pentru cei 300 de bolovani de sare de la ocna din Ghitioara și poruncește cămărașilor de la ocnă să dea merticul la vreme.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai 16");
RECORDS["_477"] = new MedievalDocuments("_477", 1654, "Constantin Șerban voievod întărește lui Mogoș căpitan din Păulești, j. Prahova, niște țigani boierești care fugiseră în Țara Turcească, pentru că a fost trimis de Matei Basarab voievod să-i aducă în țară de peste Dunăre.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai 16");
RECORDS["_478"] = new MedievalDocuments("_478", 1654, "Constantin Șerban voievod poruncește celor 12 jurători ai lui Stan din Prodilești să jure că Stan nu a fost rumân la mănăstirea Strâmbul și nici nu l-a apucat Legătura lui Mihai vodă în acel sat.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 16");
RECORDS["_479"] = new MedievalDocuments("_479", 1654, "Costea și frații lui, Ivan și Oprea, împreună cu mama lor vând lui Firea o păresiște în dealul Crângurenilor, la Budișteni, j. Argeș, cu 360 de bani și cu știrea megiașilor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Costea și frații lui, Ivan și Oprea, împreună cu mama lor", null, "Țara Românească", "3", "<1654 mai 16>");
RECORDS["_480"] = new MedievalDocuments("_480", 1654, "Nicola al toboșarului, Ciucu al gelepului, Stanciul al lui Băcilă și Pârvu Robu <din Săcelu, j. Gorj> se vând rumâni lui Nicola pârcălab din Glogova.", null, null, "Rezumat", "Constantin Șerban", "Nicola al toboșarului, Ciucu al gelepului, Stanciul al lui Băcilă și Pârvu Robu", null, "Țara Românească", "3", "1654 (7162);mai 16");
RECORDS["_481"] = new MedievalDocuments("_481", 1654, "Constantin Șerban voievod întărește lui Stoian și fraților acestuia, Oancea, Radul, Stan, Mihnea și Ion, fiii lui Albul din Davidești, j. Argeș, stăpânirea asupra unor părți de ocină în Davidești cumpărate de la Dumitru pentru 1300 de aspri.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai 17");
RECORDS["_482"] = new MedievalDocuments("_482", 1654, "Constantin Șerban voievod poruncește lui Dumitru și lui Vlaicu din Groși să-l constrângă pe Constantin căpitanul să plătească 434 de ughi, sumă luată de tatăl lui Constantin căpitanul, Radu armașul, cu sila de la Viai cu.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 20");
RECORDS["_483"] = new MedievalDocuments("_483", 1654, "Constantin Șerban voievod întărește lui Negoiță paharnic, nepotul doamnei Neaga, stăpânirea peste niște rumâni din Tătărani, pe care îi avea de moștenire de la tatăl său, Preda postelnic din Tătărani.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);mai 20");
RECORDS["_484"] = new MedievalDocuments("_484", 1654, "Mihai clucerul și Giura clucer se înțeleg cu Pană cămărașul să le vândă satul Cacoții, pentru că aceștia l-au plătit de bir.", "Română", "Hârtie", "Original", "Constantin Șerban", "Mihai clucerul și Giura clucer", null, "Țara Românească", "3", "1654 (7162);mai 22");
RECORDS["_485"] = new MedievalDocuments("_485", 1654, "Nan, fratele lui Vișan din Scăiani, adeverește lui Moise căpitanul că i-a vândut părțile de moșii din Scăiani, Bâsca și Ulmet.", "Română", "Hârtie", "Original", "Constantin Șerban", "Nan, fratele lui Vișan din Scăiani", null, "Țara Românească", "3", "1654 (7162);mai 22");
RECORDS["_486"] = new MedievalDocuments("_486", 1654, "Constantin Șerban voievod întărește lui Iordache postelnic, stăpânirea peste sătenii din Negrași, ce i s-au vândut ca vecini.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 22");
RECORDS["_487"] = new MedievalDocuments("_487", 1654, "Stamate călăraș, Toader ceauș Necula, Apostol și alții vând lui Lupșa o moșie de 44 de stânjeni pentru 2200 de bani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stamate călăraș, Toader ceauș Necula, Apostol și alții", null, "Țara Românească", "3", "1654 (7162);mai 23");
RECORDS["_488"] = new MedievalDocuments("_488", 1654, "Constantin căpitan, fiul lui Radu armaș, vinde lui Iorga și Pană negustori satul Groși, j. Argeș, cu rumânii și cu via pentru 434 ughi, bani pe care îi prădase tatăl lui de la acești negustori, fără nici o vină.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin căpitan, fiul lui Radu armaș", null, "Țara Românească", "3", "1654 (7162);mai 25");
RECORDS["_489"] = new MedievalDocuments("_489", 1654, "Pătrașcu ceaușul și frații lui, Iancul și Dumitru, vând lui Constantin Cantacuzino fost mare postelnic, un loc de casă, lângă biserica Tabacilor în București.", "Română", "Hârtie", "Original", "Constantin Șerban", "Pătrașcu ceaușul și frații lui, Iancul și Dumitru", null, "Țara Românească", "3", "1654 (7162);mai 25");
RECORDS["_490"] = new MedievalDocuments("_490", 1654, "Mihai postelnic, fiul lui Toma comis din Pătroaia, adeverește lui Iordache postelnic, fiul lui Trufanda fost mare vistier, că o seamă de rumâni au fost mai întâi ai unchiului său, Leca spătar, dar după judecățile domnești, acum i se cuvin lui Iordache postelnic.", null, "Microfilm", null, "Constantin Șerban", "Mihai postelnic, fiul lui Toma comis din Pătroaia", null, "Țara Românească", "3", "1654 (7162);mai 26");
RECORDS["_491"] = new MedievalDocuments("_491", 1654, "Constantin Șerban voievod hotărăște ca jupâneasa Caplea din Florești și Paraschiv din Cepturoaia să dea lui Preda spătar din Cepturoaia un alt sat la schimb pentru Cioroboreni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);<mai> 28");
RECORDS["_492"] = new MedievalDocuments("_492", 1654, "Constantin Șerban voievod întărește tuturor slujitorilor care au moșie în stăpânire la Bălănești <j. Râmnicu Sărat> să țină aceste moșii, fiind ei contribuabili la haraciul împăratului.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);mai 30");
RECORDS["_493"] = new MedievalDocuments("_493", 1654, "Constantin Șerban voievod dăruiește mănăstirii Snagov satul Dobroșești, j. Ilfov, iertându-l de toate dările de peste an, mănăstirea să aibă pace de toți slujitorii și drept exclusiv de judecată, precum și zeciuiala de vin din podgoria Cernătești.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);mai 30");
RECORDS["_494"] = new MedievalDocuments("_494", 1654, "Iane mătăsar și soția lui, Voica, vând jupânului Teodori Chiurcia o prăvălie în Târgul de Jos din București, împreună cu locul ei, pentru 45 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Iane mătăsar și soția lui, Voica", null, "Țara Românească", "3", "1654 (7162);mai 31");
RECORDS["_495"] = new MedievalDocuments("_495", 1654, "Ștefan logofăt din Ciorani, împreună cu fratele său, Vasilie iuzbașa, vând 300 stânjeni de moșie în Mircești lui Neagoe logofăt de vistierie.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ștefan logofăt din Ciorani, împreună cu fratele său, Vasilie iuzbașa", null, "Țara Românească", "3", "1654 (7162);iunie");
RECORDS["_496"] = new MedievalDocuments("_496", 1654, "Constantin Șerban voievod poruncește jupânesii Stanca să restituie 12 ughi popii Tatomir, împrumutați de la Radul Păduche din Gogoși ca să plătească mierea satului.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 2");
RECORDS["_497"] = new MedievalDocuments("_497", 1654, "Constantin Șerban voievod întărește lui Ilea paharnic, Paraschiva paharnic și lui Manea paharnic din Urechești, j. Râmnicul Sărat, dreptul de stăpânire asupra mai multor pogoane de vie în dealul Teișului.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 3");
RECORDS["_498"] = new MedievalDocuments("_498", 1654, "Constantin Șerban întărește lui Neagul paharnic, fiul lui Stan, și altor megiași stăpânirea asupra unor părți de ocină în hotarul Frăsinetului și în Devesel.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 3");
RECORDS["_499"] = new MedievalDocuments("_499", 1654, "Constantin Șerban voievod poruncește celor șase boieri judecători luați de megiașii din satul Șovârcu, de Radul comis și Necula postelnic, să adevereze dacă Zaharia sluger, moșul lui Radul comis și Necula postelnic, a avut parte de moșie în Șovârcu.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 3");
RECORDS["_500"] = new MedievalDocuments("_500", 1654, "Constantin Șerban voievod întărește lui Lupul călăraș din Călugăreni, Oprea călăraș ș. a. stăpânirea asupra moșiei Grozeștii, j. Teleorman, pe care o aveau de la părinții lor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 4");
RECORDS["_501"] = new MedievalDocuments("_501", 1654, "Constantin Șerban voievod întărește lui Cilibia ceauș de dorobanți din Tâmna dreptul de a lua dijmă din toată zeciuiala de pe moșia lui, Pavlețul din j. Mehedinți.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 4");
RECORDS["_502"] = new MedievalDocuments("_502", 1654, "Constantin Șerban voievod întărește lui Cilibia ceauș de dorobanți din Tâmna, fiul lui Frățilă, stăpânire în ocina satului Tâmna, cumpărată de la Danciul vornic, tatăl lui Matei Basarab.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 5");
RECORDS["_503"] = new MedievalDocuments("_503", 1654, "Constantin Șerban voievod poruncește celor 24 de boieri jurători ai lui Neagul portar să jure că acesta nu a rumânit în silă satul Mărăcinenii, j. Dâmbovița.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 5");
RECORDS["_504"] = new MedievalDocuments("_504", 1654, "Constantin Șerban voievod întărește lui Alexie ceauș, fiul lui Mihai Carșote din Mărăcineni, stăpânirea peste partea de ocină din Dedulești a lui Dumitrașco, fiul lui Alexie din orașul de Floci.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 6");
RECORDS["_505"] = new MedievalDocuments("_505", 1654, "Constantin Șerban voievod întărește lui Danciu călăraș și altora stăpânirea asupra părților lor de ocină din satul Stănești de Obreje, j. Vlașca, împresurate de Matei Basarab.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 6");
RECORDS["_506"] = new MedievalDocuments("_506", 1654, "Constantin Șerban voievod volnicește pe sătenii din Mușătești, Stoica, Priba, Tatul și Dragne să răscumpere părțile lor de moșie lor din satul Mușătești de pe Vedea, j. Teleorman.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 6");
RECORDS["_507"] = new MedievalDocuments("_507", 1654, "Constantin Șerban voievod întărește lui Vintilă și lui Drăgoiu căpitan, ginerele lui Tudosie ban, stăpânirea asupra unor părți de ocină în Găujani, j. Ilfov.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 6");
RECORDS["_508"] = new MedievalDocuments("_508", 1654, "Doisprezece boieri luați de Chirca mare stolnic și Hera roșul din Berești, cu Mănăilă paharnic din Văleni, aleg moșia lor din satul Văleni, j. Olt, și hotărăsc să se facă 2 roate de moară în vadul ce-l au împreună.", "Română", "Hârtie", "Original", "Constantin Șerban", "Doisprezece boieri", null, "Țara Românească", "3", "1654 (7162);iunie 7");
RECORDS["_509"] = new MedievalDocuments("_509", 1654, "Ignatie, egumenul mănăstirii Mihai Vodă, și Stoica paharnic din Dragomirești adeveresc megieșilor din Stănești dreptul de a stăpâni în pace moșia lor, ce fusese împresurată de Matei Basarab.", "Română", null, "Copie", "Constantin Șerban", "Ignatie, egumenul mănăstirii Mihai Vodă, și Stoica paharnic din Dragomirești", null, "Țara Românească", "3", "1654 (7162);iunie 7");
RECORDS["_510"] = new MedievalDocuments("_510", 1654, "Neacșul și Stroe, împreună cu nepoții lor, vând popii Simca partea de ocină a lui Tatu din Fundeani și din Salce pentru 6 ughi și 20 bani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Neacșul și Stroe, împreună cu nepoții lor", null, "Țara Românească", "3", "1654 (7162);iunie 7");
RECORDS["_511"] = new MedievalDocuments("_511", 1654, "Constantin Șerban voievod împuternicește pe Jipa postelnic din Vernești să fie volnic, împreună cu o slugă domnească, să ridice niște țigani de la Radu logofăt Dudescu cu care a avut judecată în divan.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 7");
RECORDS["_512"] = new MedievalDocuments("_512", 1654, "Constantin Șerban voievod întărește mănăstirii Sadova dreptul de stăpânire asupra rumânilor din Gârleni, j. Dolj, și a părților lor de moșie care s-au vândut lui Matei Basarab.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 7");
RECORDS["_513"] = new MedievalDocuments("_513", 1654, "Constantin Șerban voievod întărește lui Stoica, fiul lui Neagul din Felii, stăpânirea peste 3 pogoane de vie în Găvana, j. Prahova, cu un stânjen de ocină, partea lui Coman.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 7");
RECORDS["_514"] = new MedievalDocuments("_514", 1654, "Arca din Stolojani, fiul lui Tatomir, vinde lui Dușe postelnic din Stolojani un loc la Lacul Frasinilor. Dușe postelnic mai cumpără și de la alții locuri și părți de moșie.", "Română", "Hârtie", "Original", "Constantin Șerban", "Arca din Stolojani, fiul lui Tatomir", null, "Țara Românească", "3", "1654 (7162);iunie 8");
RECORDS["_515"] = new MedievalDocuments("_515", 1654, "Mai mulți megiași din Glupavi dau zapisul lor la mâna lui Gheorghe vistier, cum că i-au vândut acestuia partea lor de moșie din sat, ca să se răscumpere din rumânie.", "Română", "Hârtie", "Original", "Constantin Șerban", "Cârstea, Neagul și Dragnea, fiii unchiașului Neguț din Glupavi", null, "Țara Românească", "3", "1654 (7162);iunie 8");
RECORDS["_516"] = new MedievalDocuments("_516", 1654, "Megieșii din Saca adeveresc lui Andrei postelnic că nu au avut putere să se răscumpere din rumânie, atunci când Constantin Șerban voievod a îngăduit ca satele lui Matei Basarab voievod să se răscumpere din rumânie.", "Română", "Hârtie", "Original", "Constantin Șerban", "Megieșii din Saca", null, "Țara Românească", "3", "1654 (7162);iunie 8");
RECORDS["_517"] = new MedievalDocuments("_517", 1654, "Constantin Șerban voievod întărește lui Stepan postelnic din Stoiceani să stăpânească moșia Costeani, j. Ialomița, cu viile de la Săteni, după moartea cumnatei sale, Anca.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 8");
RECORDS["_518"] = new MedievalDocuments("_518", 1654, "Calea, fata lui Gostilă, vinde lui Stanciul partea ei de ocină <din Trânșani>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Calea, fata lui Gostilă", null, "Țara Românească", "3", "1654 (7162);iunie 9, „ în zilele lui Matei voievod\"");
RECORDS["_519"] = new MedievalDocuments("_519", 1654, "Șase boieri hotarnici luați de Stoican paharnic din Cârlomănești și Negoi clucer adeveresc care este drumul lui Stoican, în timp ce drumul lui Negoi clucer nu este acolo, ci pe vale.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase boieri hotarnici", null, "Țara Românească", "3", "1654 (7162);iunie 9");
RECORDS["_520"] = new MedievalDocuments("_520", 1654, "Constantin Șerban voievod scrie lui Pană cămăraș, „care este oier\", că înaintea sa au venit călugării de la mănăstirea Segarcea și că i-a scutit de toate dările de peste an.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 10");
RECORDS["_521"] = new MedievalDocuments("_521", 1654, "Constantin Șerban voievod întărește lui Mihai comis și fraților săi, Preda și Barbu, fiii lui Dumitru Filișanu fost mare stolnic, dreptul de stăpânire asupra satelor Dârvariul și Risipiți, j. Mehedinți.", "Slavonă", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 11");
RECORDS["_522"] = new MedievalDocuments("_522", 1654, "Constantin Șerban voievod întărește jupaniței Mihna și surorii ei, Marula logofeteasa, fetele lui Ilie vornic din Cornești, dreptul de stăpânire asupra satul Hăndreșăștii, j. Ialomița, și cu rumânii cu care au avut pâră în divan.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 11");
RECORDS["_523"] = new MedievalDocuments("_523", 1654, "Constantin Șerban voievod întărește sătenilor din Brebu, j. Prahova, dreptul de a stăpâni ocina satului împreună cu mănăstirea Sf. Mihail din sat, ctitorită de Matei Basarab voievod.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 12");
RECORDS["_524"] = new MedievalDocuments("_524", 1654, "Constantin Șerban voievod întărește stăpânirea lui Barbu cupariul asupra rumânului Radu din Bărbărești cu fiii lui, în urma judecății avute cu Lupul și Pătru.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 13");
RECORDS["_525"] = new MedievalDocuments("_525", 1654, "Constantin Șerban voievod întărește negustorilor chiproviceni scutirea de toate dările, în schimbul unui „bir cu rupta\", o dată pe an, în valoare de 130 de ughi.", null, null, null, "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 14");
RECORDS["_526"] = new MedievalDocuments("_526", 1654, "Constantin Șerban voievod întărește lui Buliga fost aga din Ciovârnășani dreptul de stăpânire asupra mănăstirii Topolnița, j. Mehedinți, iertând toate proprietățile mănăstirii de plata dăjdiilor.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 14");
RECORDS["_527"] = new MedievalDocuments("_527", 1654, "Constantin Șerban voievod întărește mănăstirii Coșuna, de lângă Craiova, un loc de casă din București, dăruit acesteia de Pârvul fost mare logofăt.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 14");
RECORDS["_528"] = new MedievalDocuments("_528", 1654, "Jupânița Stănae <din Gherghița> și fiii ei adeveresc că au luat bani cu dobândă 80 ughi de la părintele Varlaam de la mănăstirea Căldărușani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Jupânița Stănae și fiii ei", null, "Țara Românească", "3", "1654 (7162);<ante iunie 15>");
RECORDS["_529"] = new MedievalDocuments("_529", 1654, "Preda Brâncoveanu mare vornic, în calitate de moștenitor al bunurilor personale ale voievodului Matei Basarab adeverește, în urma unui jurământ pe Evanghelie, că Andrei spătarul are dreptul să-și recupereze țiganii pe care răposatul voievod i-a luat, fără să plătească nimic.", "Română", "Hârtie", "Original", "Constantin Șerban", "Preda Brâncoveanu mare vornic", null, "Țara Românească", "3", "1654 (7162);iunie 15");
RECORDS["_530"] = new MedievalDocuments("_530", 1654, "Manea și verii lui, Neagul, Ion și Bărcan, vând lui Tănasie portar parte de moșie în Oiești, j. Teleorman, cu 4 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Manea și verii lui, Neagul, Ion și Bărcan", null, "Țara Românească", "3", "1654 (7162);iunie 15");
RECORDS["_531"] = new MedievalDocuments("_531", 1654, "Șase boieri aleg părțile de moșie cumpărate de Radu armașu în Budești, județul Râmnicul Sărat, de la Necula din Ursești, delimitându-le de proprietatea mănăstirii Urechești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase boieri", null, "Țara Românească", "3", "1654 (7162);iunie 15");
RECORDS["_532"] = new MedievalDocuments("_532", 1654, "Vlad, fiul lui Oprea Gogoș, vinde lui Pană cămărașul ocina lui din satul Turburea, cu vad de moară, pentru 6 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Vlad, fiul lui Oprea Gogoș", null, "Țara Românească", "3", "1654 (7162);iunie 15");
RECORDS["_533"] = new MedievalDocuments("_533", 1654, "Constantin Șerban voievod iartă pe poslușnicii care se află pe moșiile mănăstirii <Dintrunlemn>, județul Vâlcea, de bir și de toate dajdiile, cu condiția să slujească pe mai departe pe starețul acesteia.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7126);iunie 15");
RECORDS["_534"] = new MedievalDocuments("_534", 1654, "Constantin Șerban voievod poruncește vameșilor de la bălțile Potelu și Celeiu să dea mănăstirii Bistrița, din partea domnească, al treilea ban, din cârmă și din tot venitul bălților.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 15");
RECORDS["_535"] = new MedievalDocuments("_535", 1654, "Sava logofăt, Șerban căpitan, Iancu logofăt și alții se tocmesc cu egumenul Varlaam de la mănăstirea Căldărușani pentru 300 de stânjeni de ocină la Ciorani ca acesta să le plătească contravaloarea pământului, despre care pretinsese că fusese lăsat mănăstirii de tatăl acestor boieri, Oancea logofăt.", "Română", "Hârtie", "Original", "Constantin Șerban", "Sava logofăt, Șerban căpitan, Iancu logofăt și alții", null, "Țara Românească", "3", "1654 (7162);iunie 16");
RECORDS["_536"] = new MedievalDocuments("_536", 1654, "Constantin Șerban poruncește episcopului de Buzău și vornicului Colțea Doicescu să nu mai împresoare viile megiașilor din Văleni, j. Buzău.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 16");
RECORDS["_537"] = new MedievalDocuments("_537", 1654, "Constantin Șerban voievod întărește mănăstirii Coșuna de lângă Craiova și egumenului acesteia, Ionichie, satele Perișorul și Radovanul din județul Mehedinți, în urma verificării actelor de proprietate și a actelor de vânzare a rumânilor.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 17");
RECORDS["_538"] = new MedievalDocuments("_538", 1654, "Constantin Șerban voievod scutește de bir și de toate dăjdiile pe locuitorii din Sinești, j. Prahova, care locuiesc în jurul mănăstirii Mislea și o slujesc.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 17");
RECORDS["_539"] = new MedievalDocuments("_539", 1654, "Constantin Șerban voievod întărește lui Sirea roșul și fratelui acestuia, Gheorghie roșul, din Pleșcoi, j. Buzău, ocina cumpărată de ei în Negoșina, în urma unei judecăți pierdute de Bratul, ginerele vânzătorului.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 17");
RECORDS["_540"] = new MedievalDocuments("_540", 1654, "Ghinea postelnic din Cătun scrie egumenului Nicodim al mănăstirii Tismana despre niște țigănci ale mănăstirii, fugite cu niște țigani ai lui, despre care se angajează să le înapoieze mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ghinea postelnic din Cătun", null, "Țara Românească", "3", "1654 (7162);iunie 18");
RECORDS["_541"] = new MedievalDocuments("_541", 1654, "Stoica și Stănie vând lui Ventilă, lftenie și lui Neacșul partea lor de loc <din Beleți>, cu 28 de costande.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stoica și Stănie", null, "Țara Românească", "3", "1654 (7162);iunie 18");
RECORDS["_542"] = new MedievalDocuments("_542", 1654, "Constantin Șerban voievod întărește lui Barbul cupariul și lui Udriște cămăraș, cu fiii lor, ocină în Mârzănească de Jos, < j. Ilfov>.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 18");
RECORDS["_543"] = new MedievalDocuments("_543", 1654, "Gorgan clucer, Necula și Fota, fiii lui Drăgușin paharnic, răscumpără de la Voica al doilea paharnic jumătate din satul Runcu, cu 600 ughi, și partea lui Gheorghe postelnic, cu 190 ughi.", null, null, "Rezumat", "Constantin Șerban", "Gorgan clucer, Necula și Fota, fiii lui Drăgușin paharnic", null, "Țara Românească", "3", "1654 (7162);iunie 18");
RECORDS["_544"] = new MedievalDocuments("_544", 1654, "Constantin Șerban voievod întărește eliberarea din rumânie a sătenilor din Căzăneștii Spatăi, din plasa de la Vale, j. Olt, dinspre fiii lui Drăgușin paharnic.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 20");
RECORDS["_545"] = new MedievalDocuments("_545", 1654, "Constantin Șerban voievod întărește jupânesei Neacșa, fata lui Costea sluger, fiului său, Mihalcea logofăt, și cu frații lui, din Crevedia, de pe apa Neajlovului, județul Vlașca, moșie în satul Crevedia.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 20");
RECORDS["_546"] = new MedievalDocuments("_546", 1654, "Constantin Șerban voievod întărește mănăstirii Viforâta și monahiei Magdalina dreptul de stăpânire asupra satelor Vărăștii și Gurguiații de pe Mostiște, j. Ilfov.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 20");
RECORDS["_547"] = new MedievalDocuments("_547", 1654, "Constantin Șerban voievod poruncește Dumitrei, văduva lui Mihai șoimaru din Târgoviște, și rudelor acesteia să nu mai aibă nici o pretenție asupra logofătului Dumitru Bădilă din Târgoviște, în pricina pentru un loc și trei prăvălii la Târgoviște.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);<post iunie 20 - ante august 31>");
RECORDS["_548"] = new MedievalDocuments("_548", 1654, "Șase boieri, luați pe răvașe domnești de Manta, fiul lui Pană din Câmpulung și de egumenul Iosaf de la mănăstirea Câmpulung, adeveresc pentru un iaz și o moară care aparțineau lui Manta.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase boieri", null, "Țara Românească", "3", "1654 (7162);iunie 21");
RECORDS["_549"] = new MedievalDocuments("_549", 1654, "Constantin Șerban voievod întărește jupanului Radu Cocorăscu fost mare logofăt 14 scutelnici pe ocina sa de la Palanga, j. Ilfov și doi lopătari, oameni străini, fiind o moșie dăruită de Șerban voievod pentru dreaptă și credincioasă slujbă.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 21");
RECORDS["_550"] = new MedievalDocuments("_550", 1654, "Constantin Șerban voievod întărește egumenului de la mănăstirea Radu Vodă din București dijma din satele mănăstirii, Chiseleț, Găunoșii, Dichiseni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 21");
RECORDS["_551"] = new MedievalDocuments("_551", 1654, "Constantin Șerban voievod întărește lui Stepan postelnic și fiului său, Tănasie, un rumân, Iane din Bălcești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 21");
RECORDS["_552"] = new MedievalDocuments("_552", 1654, "Constantin Șerban voievod întărește lui Tudoran paharnic, fiul lui Iane paharnic, din Aninoasa, j. Mușcel, o țigancă, în urma unui schimb cu Antonie din Rătești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 21");
RECORDS["_553"] = new MedievalDocuments("_553", 1654, "Constantin Șerban voievod întărește egumenului de la mănăstirea Radu Vodă din București dreptul asupra vămii de pește din balta de la Chiseleț și asupra părpărului.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 22");
RECORDS["_554"] = new MedievalDocuments("_554", 1654, "Constantin Șerban voievod hotărăște ca Stanciul spătar, fratele acestuia, Vladu, vărul lui, Coica armaș, popa Ciucur și fratele său din Săcel să „lepede\" lui Nicola pârcălab din Glogova și lui Barbu Bengescu, ginerele acestuia, banii pentru rumânie.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 22");
RECORDS["_555"] = new MedievalDocuments("_555", 1654, "Ghiorma Alexeanu mare ban al Craiovei întărește mănăstirii Bucovățu, la Coșuna, moșia Povarul, în urma unei judecăți pierdute de Papa postelnic din Livezi.", "Română", null, "Copie", "Constantin Șerban", "Ghiorma Alexeanu mare ban al Craiovei", null, "Țara Românească", "3", "1654 (7162);iunie 23");
RECORDS["_556"] = new MedievalDocuments("_556", 1654, "Constantin Șerban voievod poruncește căpitanului Pahul din Strehaia să adune pe locuitorii satelor Strehaia, Coșcodia, Stângăcea la vetrele lor, să plătească birul și să slujească mănăstirii Strehaia.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 23");
RECORDS["_557"] = new MedievalDocuments("_557", 1654, "Constantin Șerban voievod judecă pe țiganul Radul care fusese al stolnicului Stanciul, dar fugise.", null, null, null, "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 23");
RECORDS["_558"] = new MedievalDocuments("_558", 1654, "Constantin Șerban voievod întărește lui Răduțul iuzbașa din Medvejde, j. Mehedinți, satul Groși, cu rumânii, cumpărat de socrul acestuia, Giurca clucer și moștenit de el.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 23");
RECORDS["_559"] = new MedievalDocuments("_559", 1654, "Constantin Șerban voievod poruncește boierilor jurători ai lui Tudoran, ginerele lui Dumitru Ochea și ai jupânesei sale, Anca din Nicopole, să jure pentru niște zapise de danie, făcute înaintea patriarhului Paisie al Ierusalimului.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 23");
RECORDS["_560"] = new MedievalDocuments("_560", 1654, "Draghia vinde lui Băjan partea sa de moșie din Goziiani <j. Teleorman>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Draghia", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_561"] = new MedievalDocuments("_561", 1654, "Mitropolitul lgnatie al Ungrovlahiei cumpără cu 34 ughi o țigancă de la mănăstirea Căldărușani, dăruită de un rumân ca să se răscumpere din rumânie, ca să nu se spargă sălașul Mitropoliei.", "Română", "Hârtie", "Original", "Constantin Șerban", "Mitropolitul lgnatie al Ungrovlahiei", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_562"] = new MedievalDocuments("_562", 1654, "Mitropolitul Ignatie al Ungrovlahiei adeverește jurământul lui Radul iuzbașă, din Medvejde, din județul Mehedinți, care jură că nu a luat nici un ban pe moșia Groșii, confiscată de Matei voievod și dată mănăstirii Strehaia.", "Română", null, "Copie", "Constantin Șerban", "Mitropolitul lgnatie al Ungrovlahiei", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_563"] = new MedievalDocuments("_563", 1654, "Egumenul Varlaam al mănăstirii Căldărușani adeverește mitropolitului Ignatie că Mitropolia a fost datoare mănăstirii o țigancă, pe care mitropolitul a plătit-o.", "Română", "Hârtie", "Original", "Constantin Șerban", "Egumenul Varlaam al mănăstirii Căldărușani", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_564"] = new MedievalDocuments("_564", 1654, "Vasile logofăt din Rătevoiești adeverește egumenului Vasile al mănăstirii Bistrița schimbul de țigani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Vasile logofăt din Rătevoiești", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_565"] = new MedievalDocuments("_565", 1654, "Constantin Șerban voievod întărește mănăstirii Bistrița dreptul de stăpânire asupra satului Costești, j. Vâlcea, cu rumâni, vie și muntele Neteda, dăruit acesteia de voievodul Mihai Viteazul.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_566"] = new MedievalDocuments("_566", 1654, "Constantin Șerban voievod întărește Episcopiei de Buzău ocina la Vernești, partea lui Ilarion episcop și a fratelui acestuia, Ivan din Vernești, pentru care mănăstirea fusese prădată cu 600 ughi de către Radu Mihnea voievod.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_567"] = new MedievalDocuments("_567", 1654, "Constantin Șerban voievod întărește lui Nicola Glogoveanul clucer niște rumâni din Broscari, care susțineau că nu sunt rumâni ai clucerului, ci ai marelui vornic Preda Brâncoveanu.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_568"] = new MedievalDocuments("_568", 1654, "Constantin Șerban voievod întărește lui Bunea Grădișteanu mare vistier stăpânirea peste ocina și vecinii din satul Izbiceni, j. Romanați, pe care îl avea de zestre de la socrul sau, Miho spătar.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_569"] = new MedievalDocuments("_569", 1654, "Constantin Șerban voievod întărește boierilor Necula postelnicul, Apostol și Stroe stăpânire asupra satului Poienari <j. Argeș>.", "Română", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_570"] = new MedievalDocuments("_570", 1654, "Constantin Șerban voievod întărește mănăstirii Strehaia dreptul de stăpânire asupra satului Strehaia cu rumânii, închinat acesteia de Matei Basarab voievod.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_571"] = new MedievalDocuments("_571", 1654, "Belciu vinde lui Stanciul, ginerele său, 5 stânjeni de ocină în funia balotească cu 500 de bani.", "Română", null, "Copie", "Constantin Șerban", "Belciu", null, "Țara Românească", "3", "1654 (7162);iunie 27");
RECORDS["_572"] = new MedievalDocuments("_572", 1654, "Gherghe și nepotul său, Ion se înfrățesc cu Făta, dăruindu-l cu 50 de stânjeni de moșie în Berilești, iar acesta le-a dăruit un caș bun și o bogată de postav.", "Română", null, "Copie", "Constantin Șerban", "Gherghe și nepotul său, Ion", null, "Țara Românească", "3", "1654 (7162);iunie 27");
RECORDS["_573"] = new MedievalDocuments("_573", 1654, "Constantin Șerban voievod iartă de rumânie satul Băbiciu, j. Romanați, care s-a plâns de nedreptatea făcută de răposatul voievod Matei Basarab pe vremea când era boier.", null, null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 28");
RECORDS["_574"] = new MedievalDocuments("_574", 1654, "Constantin Șerban voievod întărește mănăstirii Glavaciog și egumenului Nechifor parte de moșie de la Obislav, <j. Vlașca>, în urma unei judecăți cu megiașii din Coțăieni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 29");
RECORDS["_575"] = new MedievalDocuments("_575", 1654, "Constantin Șerban voievod întărește lui Radu și fratelui său, Neagoe, fiii lui Neagoe postelnic, ocină în satul Cărunți <j. Prahova>.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "<1654-1657> iunie 29");
RECORDS["_576"] = new MedievalDocuments("_576", 1654, "Constantin Șerban voievod poruncește celor 6 boieri judecători ai jupânesei Ilinca, fata lui Mușat vistier și ai nepotului ei, Hriza, fiul lui Vasile spătar, să cerceteze moșiile, rumânii și țiganii lui Mușat vistier.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 30");
RECORDS["_577"] = new MedievalDocuments("_577", 1654, "Constantin Șerban voievod întărește lui Velisarie logofăt și lui Sima negustor moșia Pârțâianii, j. Ialomița și toată partea de moșie din Golăni, împresurate de Matei Basarab voievod „precum au fost luat toate moșiile boierilor țării\".", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 30");
RECORDS["_578"] = new MedievalDocuments("_578", 1654, "Constantin Șerban voievod acordă mănăstirii lui Dan vistiarul de la Colentina și egumenului Mihail dreptul de a face slobozie.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie");
RECORDS["_579"] = new MedievalDocuments("_579", 1654, "Căpitanul Preda Bologa vinde egumenului Teodosie de la mănăstirea Strehaia pe Ghera țiganul cu țiganca sa și copiii lor, cu 30 de ughi, pentru că furase niște cai.", "Română", "Hârtie", "Original", "Constantin Șerban", "Căpitanul Preda Bologa", null, "Țara Românească", "3", "1654 (7162);iulie 1");
RECORDS["_580"] = new MedievalDocuments("_580", 1654, "Ghiera, fost țigan al voievodului Matei Basarab adeverește că a fost răscumpărat de la spânzurătoare de Teodosie, egumenul mănăstirii Strehaia.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ghiera, fost țigan al voievodului Matei Basarab", null, "Țara Românească", "3", "1654 (7162);iulie 1");
RECORDS["_581"] = new MedievalDocuments("_581", 1654, "Neagu, mama sa, Voica, și frații săi, vând lui Nan vătaf moșie în Berivoiești <j. Sac>, cu 9 ughi.", "Română", null, "Copie", "Constantin Șerban", "Neagu, mama sa, Voica, și frații săi", null, "Țara Românească", "3", "1654 (7162);iulie 2");
RECORDS["_582"] = new MedievalDocuments("_582", 1654, "Constantin Șerban voievod întărește mănăstirii Argeș satul Corbii de Piatră și metohul Merișul, cu rumânii și țigani, pe hotarele alese de 24 de boieri și om domnesc.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 2");
RECORDS["_583"] = new MedievalDocuments("_583", 1654, "Constantin Șerban voievod întărește lui Iordache postelnic, fiul lui Trufanda vistier, stăpânirea asupra satului Negrășani cu rumânii, j. Vlașca, ce i s-au vândut în timpul domniei lui Matei Basarab voievod.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 3");
RECORDS["_584"] = new MedievalDocuments("_584", 1654, "Constantin Șerban voievod întărește lui Manta roșul, fiul lui Pană din Câmpulung, un vad de moară cu iaz din orașul Câmpulung până în Valea Țigăniei.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 3");
RECORDS["_585"] = new MedievalDocuments("_585", 1654, "Constantin Șerban voievod poruncește rumânilor din Săcele, j. Gorj, să asculte de omul clucerului Nicola, pentru că boierul se afla trimis de domn la Constantinopol.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 3");
RECORDS["_586"] = new MedievalDocuments("_586", 1654, "Constantin Șerban voievod întărește lui Nicolae, năstavnicul m-rii Argeș, dreptul de a ridica dijma de pe toate moșiile mănăstirii de la Segarcea, Găneasa, Bârca, Tătarul și poruncește pârcălabilor să aibă grijă de lucrurile mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 4");
RECORDS["_587"] = new MedievalDocuments("_587", 1654, "Dragomir și Ivan, fiii lui Oprea logofăt, cu vărul lor, Stroe, vând lui Albul fustaș și soției lui, Dobra, un loc de casă în București.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dragomir și Ivan, fiii lui Oprea logofăt, cu vărul lor, Stroe", null, "Țara Românească", "3", "1654 (7162);iulie 5");
RECORDS["_588"] = new MedievalDocuments("_588", 1654, "Constantin Șerban voievod întărește jupânesei Drăgana păhărniceasa, fosta soție a lui Drăgușin paharnic, stăpânire asupra satului Deleni, j. Olt, cu vii și cu rumâni.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 5");
RECORDS["_589"] = new MedievalDocuments("_589", 1654, "Constantin Șerban voievod întărește lui Neagu fost mare portar din Vaideei o grădină cu vie în Târgoviște, care a aparținut pe jumătate mănăstirii Stelea și pe jumătate lui Stanciul bacalul.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 5");
RECORDS["_590"] = new MedievalDocuments("_590", 1654, "Constantin Șerban voievod întărește lui Stan, Hamza și Aga din Prapăr, j. Romanați, rumâni ai m-rii Brâncoveni, scutirea de bir, de taler, găleată cu fân, de lucru domnesc și de alte slujbe.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 5");
RECORDS["_591"] = new MedievalDocuments("_591", 1654, "Constantin Șerban voievod întărește lui Barbul stolnic din Poiană stăpânirea asupra satelor Sulariul și Băldăluiul, j. Gorj, cu rumânii, pe vechile hotare și semne.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 6");
RECORDS["_592"] = new MedievalDocuments("_592", 1654, "Constantin Șerban voievod întărește mănăstirii Cobia și egumenului Damaschin morile din jos de orașul Târgoviște, făcute de Matei Basarab voievod.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 6");
RECORDS["_593"] = new MedievalDocuments("_593", 1654, "Constantin Șerban voievod scrie lui Gherghe vornicul din Serdănești pentru țigăncile de la mănăstirea Strâmba, arătându-i că acestea sunt revendicate de Stamatie paharnic și de Preda paharnic.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 6");
RECORDS["_594"] = new MedievalDocuments("_594", 1654, "Constantin Șerban scrie celor 24 de boieri, luați de jupâneasa Dumitra din Masloși, să adeverească și pentru moșia lui Ianoș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 8");
RECORDS["_595"] = new MedievalDocuments("_595", 1654, "Constantin Șerban voievod poruncește celor 12 megiași jurători ai satului Groșanii, din j. Muscel, să jure dacă sătenii au fost sau nu rumâni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 8");
RECORDS["_596"] = new MedievalDocuments("_596", 1654, "Constantin Șerban voievod întărește egumenului de la mănăstirea Radu vodă din București dijma de pe toate moșiile mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 8");
RECORDS["_597"] = new MedievalDocuments("_597", 1654, "Constantin Șerban voievod întărește lui Stamatie paharnic să fie volnic să-și ia o țigancă de la Gherghie vornic din Sărdănești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 8");
RECORDS["_598"] = new MedievalDocuments("_598", 1654, "Ivan postelnic, fiul lui Oprea logofăt și al Mariei, împreună cu vărul său, Stroe, nepoții lui Mitrea, fost mare vornic, vând lui Greșiță al doilea postelnic și jupânesei lui, Stanca, un loc de casă, pentru 30 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ivan postelnic, fiul lui Oprea logofăt și al Mariei, împreună cu vărul său, Stroe, nepoții lui Mitrea, fost mare vornic", null, "Țara Românească", "3", "1654 (7162);iulie 10");
RECORDS["_599"] = new MedievalDocuments("_599", 1654, "Radoslav, cu frații săi, și Ivan, cu frații și verii săi, din Dăiești, j. Vâlcea, adeveresc lui Preda și lui Udriște din Șărineasca că au avut pâră pentru niște năpăști pe care le-au plătit aceștia din urmă.", "Română", "Hârtie", "Original", "Constantin Șerban", "Radoslav, cu frații săi, și Ivan, cu frații și verii săi, din Dăiești", null, "Țara Românească", "3", "1654 (7162);iulie 10");
RECORDS["_600"] = new MedievalDocuments("_600", 1654, "Stan, fiul călugărului Uriil, vinde lui Radul și soției sale, Neacșa, viile din Piscul Radului, cu 12 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stan, fiul călugărului Uriil", null, "Țara Românească", "3", "1654 (7162);iulie 10");
RECORDS["_601"] = new MedievalDocuments("_601", 1654, "Radu și Draghiul, fiii lui Stan, nepoții lui Draghiul din Balomirești, mărturisesc strâmb pentru rumânii din Ionești, j. Vlașca, ai lui Iordachi postelnic, fiul lui Trufanda vistier.", null, null, null, "Constantin Șerban", "Radu și Draghiul, fiii lui Stan, nepoții lui Draghiul din Balomirești", null, "Țara Românească", "3", "1654 (7162);iulie 13");
RECORDS["_602"] = new MedievalDocuments("_602", 1654, "Megiașii din satul Turburea se vând rumâni lui Pană cămăraș cu fiii, viile și moșiile lor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Megiașii din satul Turburea", null, "Țara Românească", "3", "1654 (7162);iulie 13");
RECORDS["_603"] = new MedievalDocuments("_603", 1654, "Constantin Șerban voievod poruncește celor 12 boieri jurători ai satului Scurtești <j. Buzău> să jure la Episcopia din Buzău, împreună cu satul că nu știu când a cumpărat Moise spătar din Cândești moșia din Scurtești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 13");
RECORDS["_604"] = new MedievalDocuments("_604", 1654, "Constantin Șerban voievod întărește jupânesei Elina băneasa, soția răposatului Radu Buzescu, și fiului ei, Matei coconul, satele Rătunda, Poiana, Ciuperceni, Ghidiciul și altele, după judecata cu Vasile postelnic din Breasta.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 14");
RECORDS["_605"] = new MedievalDocuments("_605", 1654, "Constantin Șerban voievod întărește egumenului Nichifor de la mănăstirea Plumbuita dijma de pe moșiile mănăstirii de la Boldorogești și Plăseni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 14");
RECORDS["_606"] = new MedievalDocuments("_606", 1654, "Radul, fiul lui Cârstian Golescul din Oteșani, își pune zălog moșia sa la Dumitru, nepotul său, pentru a răscumpăra mai multe obiecte de valoare lăsate în gaj la Fiera logofăt, când a fugit în Transilvania.", "Română", null, "Copie", "Constantin Șerban", "Radul, fiul lui Cârstian Golescul din Oteșani", null, "Țara Românească", "3", "1654 (7162);iulie 15");
RECORDS["_607"] = new MedievalDocuments("_607", 1654, "Sătenii din Bresnița de Jos și Sus <j. Mehedinți> mărturisesc pentru 300 de ughi luați de la Mihai clucer și de la Răduțul iuzbașa cu dobândă.", "Română", null, "Copie", "Constantin Șerban", "Sătenii din Bresnița de Jos și Sus", null, "Țara Românească", "3", "1654 (7164);iulie 16");
RECORDS["_608"] = new MedievalDocuments("_608", 1654, "Radul globnic și Rădan globnic plătesc o țigancă și pe fiica ei, luate de la Mihalache spătar, căruia domnul Matei Basarab i le dăruise la nuntă.", "Română", "Hârtie", "Original", "Constantin Șerban", "Radul globnic și Rădan globnic", null, "Țara Românească", "3", "1654 (7162);iulie 16");
RECORDS["_609"] = new MedievalDocuments("_609", 1654, "Constantin Șerban voievod întărește lui Hriza paharnic, fiul lui Vasile spătar, nepotul lui Mușat vistier din Pietroșani, j. Mușcel, moșie în lzvorani, în urma judecății cu mătușa lui, Ilinca, pentru că aceasta se lepădase de datoriile tatălui ei, Mușat vistier, la moartea acestuia.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 16");
RECORDS["_610"] = new MedievalDocuments("_610", 1654, "Constantin Șerban voievod întărește călărașilor din Mârzănești stăpânirea peste ocina lor din sat, în urma judecății în divan cu fiii popii Cândea din Brâncoveni.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 16");
RECORDS["_611"] = new MedievalDocuments("_611", 1654, "Constantin Șerban voievod întărește lui Stanciul căpitan de călărași din Hodivoaia moșia Boteneasca, j. Vlașca, pentru dreaptă și credincioasă slujbă.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 16");
RECORDS["_612"] = new MedievalDocuments("_612", 1654, "Voicu, fiul Sorei, vinde Cândei din Mircești ocină la Mircești, j. Vlașca, două părți dintr-o funie cu 9 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Voicu, fiul Sorei", null, "Țara Românească", "3", "1654 (7164);iulie 17");
RECORDS["_613"] = new MedievalDocuments("_613", 1654, "Constantin Șerban voievod întărește nepoatei sale, jupâneasa Ancuța, stăpânirea asupra moșiei Baciul <j. Teleorman>, având dreptul să-și ia dijma.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 17");
RECORDS["_614"] = new MedievalDocuments("_614", 1654, "Manta, vărul său, popa Necula și Marica, nepoata lor, fata fratelui lui Manta, Franța din Câmpulung, vând egumenului Variam de la mănăstirea Câmpulung un vad de moară, în urma unui proces.", "Română", "Hârtie", "Original", "Constantin Șerban", "Manta, vărul său, popa Necula și Marica, nepoata lor, fata fratelui lui Manta, Franța din Câmpulung", null, "Țara Românească", "3", "1654 (7164);iulie 18");
RECORDS["_615"] = new MedievalDocuments("_615", 1654, "Șase boieri jurători luați de Necula diacon mărturisesc pentru viile de la Valea Teancului <j. Sac> ale lui Necula diacon, fiul lui Costandin diacon din Buzău.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase boieri jurători", null, "Țara Românească", "3", "1654 (7164);iulie 18");
RECORDS["_616"] = new MedievalDocuments("_616", 1654, "Constantin Șerban voievod întărește lui Cârstea iuzbașa de roșii și jupânesei acestuia, Neacșa, pe Stanca țiganca, în urma unui proces cu popa Oana din Căldărușani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7164);iulie 18");
RECORDS["_617"] = new MedievalDocuments("_617", 1654, "Mitropolitul Ignatie al Ungrovlahiei întărește viile și moșiile Episcopiei Buzăului și episcopului Serafim, în urma unei judecăți cu Vasilie ungurul și cu urmașii episcopului Ilarion, ctitori ai mănăstirii Adâncata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Mitropolitul Ignatie al Ungrovlahiei", null, "Țara Românească", "3", "1654 (7164);iulie 23");
RECORDS["_618"] = new MedievalDocuments("_618", 1654, "Iova și Bratul ceauș din Bârsești fac schimb de țigani cu mănăstirea Căldărușani, făcându-și reciproc zapise.", "Română", "Hârtie", "Original", "Constantin Șerban", "Iova și Bratul ceauș din Bârsești", null, "Țara Românească", "3", "1654 (7164);iulie 23");
RECORDS["_619"] = new MedievalDocuments("_619", 1654, "Porumb, fiul lui Nastasie din Pârșcov, vinde diaconului Costandin, fiul popii Dobrul din Aldenii de Jos, 2 pogoane de vie în dealul Săsenilor <j. Sac>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Porumb, fiul lui Nastasie din Pârșcov", null, "Țara Românească", "3", "1654 (7164);iulie 23");
RECORDS["_620"] = new MedievalDocuments("_620", 1654, "Constantin Șerban voievod întărește mănăstirii Radu Vodă și egumenului Serafim doi copii de țigan, Stan și Marin, în urma judecății cu Andrei, fiul lui Andrei din Rogoz.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7164);iulie 23");
RECORDS["_621"] = new MedievalDocuments("_621", 1654, "Constantin Șerban voievod poruncește lui Vasilie armașul să lase dijma de pe moșia Vlădeni mănăstirii Căldărușani, pentru că moșia fusese vândută de tatăl lui Vasilie armaș lui Loiz sluger, care apoi a vândut-o mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 24");
RECORDS["_622"] = new MedievalDocuments("_622", 1654, "Constantin Șerban voievod hotărăște lui Radu Cocorăscu fost mare logofăt satul Tâncăbești, j. Ilfov.", "Română", null, "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 25");
RECORDS["_623"] = new MedievalDocuments("_623", 1654, "Constantin Șerban voievod hotărăște 12 boieri să jure pentru partea de moșie a lui Neagoe păhărnicel dinspre egumenul de la mănăstirea Izvorani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 25");
RECORDS["_624"] = new MedievalDocuments("_624", 1654, "Constantin Șerban voievod întărește lui Necula diaconul, fiul lui Constantin diaconul din Buzău, patru pogoane de vie de la Valea Teancului <j. Buzău>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 26");
RECORDS["_625"] = new MedievalDocuments("_625", 1654, "Constantin Șerban voievod poruncește celor 1 2 boieri hotarnici ai lui Vlaica postelnic să aleagă hotarul Cornetului dinspre hotarul Mileștilor, al lui Danciul mare sluger Milescu.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7164);iulie 26");
RECORDS["_626"] = new MedievalDocuments("_626", 1654, "Dragul, fiul lui Curesie, mătușa sa, Slavița, și fiul lui, Costandin, vând lui Nicula Ghiurmescul moșia Brăgărească în j. Sac, moșie stearpă, fără rumâni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dragul, fiul lui Curesie, mătușa sa, Slavița, și fiul lui, Costandin", "13689", "Țara Românească", "3", "1654 (7164);iulie 27");
RECORDS["_627"] = new MedievalDocuments("_627", 1654, "Constantin Șerban voievod întărește lui Mareș <Băjescu> logofăt stăpânirea asupra unui rumân, Cârstea Capotă cu fiii lui, din satul Băjești, j. Muscel și Pădureț, cu partea lui de moșie și cu vad de moară, cumpărat de la Drăghici, fiul lui Muja din Rătești.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7164);iulie 27");
RECORDS["_628"] = new MedievalDocuments("_628", 1654, "Constantin Șerban voievod întărește egumenului Nicolae de la mănăstirea Argeș dijma de pe moșia Segarcea <j. Olt>, jumătate din tot venitul, pentru că această moșie a fost danie din partea lui Constantin, fiul lui Preda, nepotul Bădicanului, dar fusese uzurpată de ruda acestuia, Preda postelnic din Greci.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 27");
RECORDS["_629"] = new MedievalDocuments("_629", 1654, "Cârstea și Mușat, fiii lui Marte, vând postelnicului Vintilă 50 de stânjeni din moșia din Lățeasca, cu 35 de bani stânjenul.", "Română", null, "Copie", "Constantin Șerban", "Cârstea și Mușat, fiii lui Marte", null, "Țara Românească", "3", "1654 (7164);iulie 28");
RECORDS["_630"] = new MedievalDocuments("_630", 1654, "Costea și fratele lui, Marte, vând postelnicului Vintilă 50 de stânjeni din moșia Lățească, cu 35 bani stânjenul.", "Română", null, "Copie", "Constantin Șerban", "Costea și fratele lui, Marte", null, "Țara Românească", "3", "1654 (7164);iulie 28");
RECORDS["_631"] = new MedievalDocuments("_631", 1654, "Constantin Șerban voievod scrie județului ȘI orășenilor din Argeș să nu se atingă de vamă până la Sf. Dimitrie, când se vor confrunta cu egumenul mănăstirii Argeș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 28");
RECORDS["_632"] = new MedievalDocuments("_632", 1654, "Constantin Șerban voievod întărește lui Mareș <Băjescu> logofăt ocină în satul Hurezi, j. Teleorman, în urma judecății în divan cu Micul, fiul lui Ion din Țigănești.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 28");
RECORDS["_633"] = new MedievalDocuments("_633", 1654, "Constantin Șerban voievod întărește lui Popescul căpitan din orașul Buzău ocină în siliștea numită Albeștii de pe Călmățui, j. Buzău.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 28");
RECORDS["_634"] = new MedievalDocuments("_634", 1654, "Constantin Șerban voievod întărește mănăstirii Radu Vodă din București dreptul de stăpânire asupra unor rumâni „peticari\" din satul Bălteni, j. Ilfov.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 28");
RECORDS["_635"] = new MedievalDocuments("_635", 1654, "Tărchilă și fratele lui, Neagul, vând lui Moise spătar din Cândești moșiile din Scurtești, j. Buzău, ca să poată să acopere cheltuiala făcută din cauza furtului unor stupi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Tărchilă și fratele lui, Neagul", null, "Țara Românească", "3", "1654 (7162);iulie 29");
RECORDS["_636"] = new MedievalDocuments("_636", 1654, "Constantin Șerban voievod întărește eliberarea din rumânie a moșnenilor din satul Groșani, j. Mușcel și Pădureț, de către mănăstirea Câmpulung.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 29");
RECORDS["_637"] = new MedievalDocuments("_637", 1654, "Constantin Șerban voievod întărește lui Vintilă iuzbașa și lui Cândea postelnic din Balotești satele Voivodeștii, Futeștii, Crăceștii, Scăieștii și altele din j. Teleorman.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 29");
RECORDS["_638"] = new MedievalDocuments("_638", 1654, "Constantin Șerban voievod întărește lui Felca din Urechești, fiul lui Dan, nepotul lui Felca vornic, jumătate din ocina satului, în urma unei judecăți cu Constantin, fiul lui Radu fost mare armaș, care o cumpărase în mod abuziv.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 30");
RECORDS["_639"] = new MedievalDocuments("_639", 1654, "Constantin Șerban voievod întărește mănăstirii Argeș și egumenului Nicolae o vie în dealul Goleștilor, <j. Argeș>, cumpărată de egumenul Leontie de la Dumitra și de la fiul ei, Albul, orășeni din Curtea de Argeș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 31");
RECORDS["_640"] = new MedievalDocuments("_640", 1654, "Constantin Șerban voievod întărește mănăstirii Argeș și egumenului Nicolae dijma și venitul satului Nucșoara, j. Muscel.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 31");
RECORDS["_641"] = new MedievalDocuments("_641", 1654, "Constantin Șerban voievod întărește jupânesei Rada, fiica lui Păcală din Rătești, cu surorile ei, Stancea și Neacșa, moșiile Plăticești și Sărăști, în urma unei judecăți.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 31");
RECORDS["_642"] = new MedievalDocuments("_642", 1654, "Constantin Șerban voievod întărește Mitropoliei din orașul Târgoviște vinăriciul din dealul Aninoasei, j. Dâmbovița.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august");
RECORDS["_643"] = new MedievalDocuments("_643", 1654, "Alisafta călugărița, care a fost soția lui Șteful logofăt din Pitești de Pasărea, j. Ilfov, cu nora, Rada, și fiul, Pătrașcu, vând lui Radul logofăt, ocină din moșia lor de la Pitești, 100 stânjeni cu 15 ughi.", "Română", null, "Copie", "Constantin Șerban", "Alisafta călugărița", null, "Țara Românească", "3", "1654 (7162);august 1");
RECORDS["_644"] = new MedievalDocuments("_644", 1654, "Constantin Șerban voievod hotărăște ca moșnenii satului Craiovița, din j. Dolj, să fie în pace și slobozi de rumânie de către Diicul spătar Buicescu.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 1");
RECORDS["_645"] = new MedievalDocuments("_645", 1654, "Novac negustor din Micești, j. Muscel, și soția sa, lana, vând lui lane negustor și lui Pană moșie în satul Groși, j. Argeș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Novac negustor din Micești, și soția sa, lana", null, "Țara Românească", "3", "1654 (7162);august 2");
RECORDS["_646"] = new MedievalDocuments("_646", 1654, "Constantin Șerban voievod întărește lui Radu logofăt Dudescu, fiul lui Dumitru Dudescu vistier, ocină în Bonțeștii de Jos, j. Ilfov.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 2");
RECORDS["_647"] = new MedievalDocuments("_647", 1654, "Constantin Șerban voievod întărește mănăstirii Sadova și egumenului Pahomie satele Zăvalul și Gârleani, din j. Dolj.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 2");
RECORDS["_648"] = new MedievalDocuments("_648", 1654, "Constantin Șerban voievod scutește mănăstirea Bradul de plata unor dăjdii, precum și cincizeci oameni, poslușnici ai mănăstirii.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 3");
RECORDS["_649"] = new MedievalDocuments("_649", 1654, "Constantin Șerban voievod întărește lui Mihai ceauș și fraților săi, Stanciul, Lupul și Ancul, fiii lui Cârstea din satul Cacaleți, j. Vlașca, stăpânirea asupra unor părți de ocină la Novaci, j. Teleorman.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 3");
RECORDS["_650"] = new MedievalDocuments("_650", 1654, "Constantin Șerban voievod întărește Stamatei, fata lui Crivăț, și mătușilor ei, Neaga și Maria, fetele lui Stoica Boblicescul din Șovârcu, j. Vlașca, ocină în satele Șovârcul și Gurbanul.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 3");
RECORDS["_651"] = new MedievalDocuments("_651", 1654, "Șerban și fiii lui, Stanciu și Tănasie, vând paharnicului Pătrașco și fratelui acestuia, Giura din Morânglav, partea lor de moșie din Pulași, aflată dincoace de Olt.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șerban și fiii lui, Stanciu și Tănasie", null, "Țara Românească", "3", "1654 (7162);august 4");
RECORDS["_652"] = new MedievalDocuments("_652", 1654, "Constantin Șerban voievod poruncește lui Filip postelnic din Baia și celor înfrățiți cu el care își vânduseră părțile lor de moșie lui Matei Basarab voievod să aducă la domnie banii pe care îi plătise voievodul, deoarece marele slujer Danciu Pârșcoveanul se plânsese că fusese nevoit să vândă moșia fără voia lui.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 4");
RECORDS["_653"] = new MedievalDocuments("_653", 1654, "Vasile căpitan și jupâneasa lui, Stana, vând lui Stoia chihaia căpitan și jupânesei lui, Sora, partea lui din Clinceni <j. Ilfov>, cu 31 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Vasile căpitan și jupâneasa lui, Stana", null, "Țara Românească", "3", "1654 (7162);august 5");
RECORDS["_654"] = new MedievalDocuments("_654", 1654, "Constantin Șerban voievod întărește lui Moise spătar din Cândești vii și moșie la Scurtești, în urma procesului avut cu Neagul și alți săteni din Scurtești <j. Buzău>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 6");
RECORDS["_655"] = new MedievalDocuments("_655", 1654, "Mihăilă, soția sa, Trandafira și copiii lor vând lui Ghinea Stroe o vie <la Căzănești>.", "Română", null, "Copie", "Constantin Șerban", "Mihăilă, soția sa, Trandafira și copiii lor", null, "Țara Românească", "3", "1654 (7162);august 8");
RECORDS["_656"] = new MedievalDocuments("_656", 1654, "Ghiorma Alexeanu mare ban al Craiovei întărește mănăstirii Bucovăț stăpânirea peste moșiile de la Smârdeștița, după ce s-au pârât cu urmașii lui Drăgușin <Deleanu>, mare paharnic.", "Română", null, "Copie", "Constantin Șerban", "Ghiorma Alexeanu mare ban al Craiovei", null, "Țara Românească", "3", "1654 (7162);august 8");
RECORDS["_657"] = new MedievalDocuments("_657", 1654, "Ghiorma Alexeanu mare ban al Craiovei întărește lui Vădislav clucer din Belcin rumâni în Cârna, pe care i-au apucat Legătura lui Mihai în satul lui Vădislav.", null, null, null, "Constantin Șerban", "Ghiorma Alexeanu mare ban al Craiovei", null, "Țara Românească", "3", "1654 (7162);august 8");
RECORDS["_658"] = new MedievalDocuments("_658", 1654, "Staico, fiul lui Bărcan iuzbașa din Miroși, mărturisește că a luat, împreună cu Ion portar, 34 ughi de la satul Stoienești, fără dreptate, pe vremea lui Matei Basarab voievod.", "Română", "Hârtie", "Original", "Constantin Șerban", "Staico, fiul lui Bărcan iuzbașa din Miroși", null, "Țara Românească", "3", "1654 (7162);august 9");
RECORDS["_659"] = new MedievalDocuments("_659", 1654, "Vișan dăruiește, la moartea sa, varei sale, Maria, moșie în Ogrăzeni.", null, null, "Rezumat", "Constantin Șerban", "Vișan", null, "Țara Românească", "3", "1654 (7162);august 10");
RECORDS["_660"] = new MedievalDocuments("_660", 1654, "Constantin Șerban voievod întărește lui Radu logofăt Dudescu moșiile din Scurtești, j. Buzău și satul Râmniceni, pe Sărățel, amândouă cu vii și cu mori, pentru că au fost cumpărate de tatăl acestuia, Dumitru vistier, iar apoi au fost confiscate de domnul Matei Basarab.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 10");
RECORDS["_661"] = new MedievalDocuments("_661", 1654, "Constantin Șerban voievod întărește lui Gavrilă și lui Vlad Țigănuș, fiii lui Stanciul, din satul Băicoi, j. Prahova, dreptul de stăpânire asupra părții lor de ocină din Bibarsă, j. Sac.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 11");
RECORDS["_662"] = new MedievalDocuments("_662", 1654, "Constantin Șerban voievod întărește mănăstirii Brâncoveni și egumenului Gavril ocina de la Robănești și ocina Vlășcii, cumpărate și dăruite mănăstirii de domnul Matei Basarab.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 12");
RECORDS["_663"] = new MedievalDocuments("_663", 1654, "Constantin Șerban voievod întărește lui Mihalașco logofăt, ginerele lui Mitrea pitar din Stănești și lui Pătrașco clucer, tot din Stănești, dreptul de stăpânire asupra satului Cureștii, care a fost de moștenire al lui Mitrea pitar și al lui Cernica vornic cel bătrân, din Săcuiani.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 12");
RECORDS["_664"] = new MedievalDocuments("_664", 1654, "Jupâneasa Vișa, soția pitarului Neagoe Grama din Cepturi adeverește că a cumpărat ocină în Grozești <j. Sac>, pe care apoi a dăruit-o, văduvă fiind, mănăstirii care se află în satul Grozești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Jupâneasa Vișa, soția pitarului Neagoe Grama din Cepturi", null, "Țara Românească", "3", "1654 (7162);august 14");
RECORDS["_665"] = new MedievalDocuments("_665", 1654, "Constantin Șerban voievod reîntărește mănăstirii Vieroșu și egumenului Nichifor părți de moară la Pitești, j. Muscel, dăruite cu mult timp în urmă de ctitorul mănăstirii, boierul Ivașco mare vornic din Golești.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 14");
RECORDS["_666"] = new MedievalDocuments("_666", 1654, "Gherghe, fiul lui Tatu din Șchiopeni <j. Rm. Sărat> se înfrățește cu Crâstea, fiul lui Bratu din Coietești pe o ocină.", "Română", "Hârtie", "Original", "Constantin Șerban", "Gherghe, fiul lui Tatu din Șchiopeni", null, "Țara Românească", "3", "1654 (7162);august 16");
RECORDS["_667"] = new MedievalDocuments("_667", 1654, "Constantin Șerban voievod întărește mănăstirii Arnota și egumenului Theofil dijma, venitul și vinăriciul domnesc din Bărbătești și Dobriceni, j. Vâlcea.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 17");
RECORDS["_668"] = new MedievalDocuments("_668", 1654, "Constantin Șerban voievod reîntărește satului Bărbătești, slobozia mănăstirii Arnota, j. Vâlcea, scutirea de bir și de toate dările, potrivit hrisovului de scutire al domnului Matei Basarab.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 17");
RECORDS["_669"] = new MedievalDocuments("_669", 1654, "Răduțul clucer din Medvejde se obligă să dea mănăstirii Tismana o copilă de țigan.", "Română", "Hârtie", "Original", "Constantin Șerban", "Răduțul clucer din Medvejde", null, "Țara Românească", "3", "1654 (7162);august 18");
RECORDS["_670"] = new MedievalDocuments("_670", 1654, "Constantin Șerban voievod întărește mănăstirii Cozia și egumenului Ștefan scutirea de bir a satului Călimănești, j. Vâlcea, ca să fie de ajutor pentru aducerea bucatelor mănăstirii.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 18");
RECORDS["_671"] = new MedievalDocuments("_671", 1654, "Constantin Șerban voievod reîntărește mănăstirii Cozia satul Frăsinetul de Câmp din j. Romanați, sat dăruit de mama voievodului Mihai Viteazul, călugărița Theofana și contestat mai apoi de moștenii satului și de un grup de boieri care aveau cumpărături în sat.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 18");
RECORDS["_672"] = new MedievalDocuments("_672", 1654, "Constantin Șerban voievod întărește mănăstirii Cozia și egumenului Ștefan vinăriciul din satul Jiblea j. Argeș, în urma cererii călugărilor de a face schimb, vinărici pentru vinărici cu daniile domnilor anteriori, care le dăruiseră vinăriciul domnesc din orașul Râmnic și ulița mare a orașului.", "Slavonă", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 18");
